    return (
        <tr className="text-capitalize">
            <td scope="col">{props.name}</td>
            <td scope="col">{props.culture}</td>
            <td scope="col">{props.culture_description}</td>
            <td scope="col">{props.languages}</td>
            <td scope="col">
                <Link to={"/users/" + props.name }> <button className="btn btn-sm btn-secondary">
                    <span className="fa fa-edit"/>
                    <span><strong>Select</strong></span>
                </button></Link>

            </td>
        </tr>
    );
}

export default userRow;
